import React from 'react'
import {Image, Container, Row, Col, Jumbotron} from 'react-bootstrap';


export default class About extends React.Component{
    render(){
        return(
            <div> 
            &nbsp;
            <Container>

            <Row>
                <Jumbotron>
                <Col>
                <h1>Mario Rodriguez</h1>
                &nbsp;
                <h2>Full-stack web developer with a passion for problem-solving. With experience in Ruby on Rails, JavaScript, and React I discovered web development while taking computer science classes and I fell in love with it. I bring strong skills in working with people, communication in English and Spanish as well as managing people. I spend my free time playing guitar as well as building small projects and learning about new technologies.</h2>
                </Col>
                </Jumbotron>
                <Col lg>
                <Image src="../assets/0.jpg" rounded />
                </Col>
            </Row>

            </Container>
            </div>
        )
    }
}




